    public class Handle_PLAYER_LOGIN : HandleBase<Packet_PLAYER_LOGIN>
    {
        private MemberRepository _memberRepository { get; set; }

        public Handle_PLAYER_LOGIN(Player player) : base(player)
        {
            _memberRepository = new MemberRepository();

            Handle();
        }

        public void Handle()
        {
            Player.LoadMember(PacketResult.Username);

            var code = _memberRepository.USP_GAME_LOGIN(Player.Member_Old.UID, Player.Member_Old.Username, PacketResult.AuthKeyLogin, PacketResult.AuthKeyGame);

            if (Player.Member_Old == null || code != 1)
            {
                Console.WriteLine("[ERROR]: client <> nil");
                Player.Send(new byte[] { 0x76, 0x02, 0x2D, 0x01, 0x00, 0x00 }); //send code 300
                Player.Server.DisconnectPlayer(Player);
                return;
            }

            if (PacketResult.ServerVersion != "824.00")
            {
                //0x0B = Server Invalide
                //0xD3 = duplicate packet login?
                Player.Send(new byte[] { 0x44, 0x00, 0x0B, });
                Player.Disconnect();
            }

            if (code == 1)
            {
                SendJerk();

                PlayerRequestInfo();
            }
        }

