        private byte[] GuildInfo()
        {
            var Reply = new PangyaBinaryWriter();

            Reply.Write(Player.Guild.GUILD_INDEX);//GUILD ID?
            Reply.WriteStr(Player.Guild.GUILD_NAME, 17);//GUILD NAME(TH > 21, US 17)
            Reply.Write((UInt32)0); // guild level point ok
            Reply.Write((UInt32)0); //guild pangs OK  
            Reply.Write((UInt32)Player.Guild.GUILD_TOTAL_MEMBER); //guild total member ok
            Reply.WriteStr(Player.Guild.GUILD_IMAGE, 9); //GuilD_IMAGE
            Reply.WriteEmptyBytes(3);
            Reply.WriteStr(Player.Guild.GUILD_NOTICE, 0x65);//GUILD_Notice
            Reply.WriteStr(Player.Guild.GUILD_INTRODUCING, 101);//GUILD_INTRODUCING
