            Reply.Write((UInt32)Player.Guild.GUILD_LEADER_UID); //// Guild Leader UID?
            Reply.WriteStr(Player.Guild.GUILD_LEADER_NICKNAME, 22); //guild leader nickname OK
            return Reply.GetBytes();
        }

